import React from "react";
import Checkbox from "./Checkbox";
import cl from "./CheckList.module.css";
import { useState } from "react";

const CheckList = ({ options, setOptions }) => {
  const handleOption = (option) => {
    options[option.id].value = option.value;
    setOptions(options);
    console.log(options);
  };

  return (
    <div className={cl.checkList} onChange={options}>
      {options.map((option) => (
        <Checkbox
          key={option.id}
          id={option.id}
          label={option.label}
          value={option.value}
          onChange={(option) => handleOption(option)}
        />
      ))}
    </div>
  );
};

export default CheckList;
